import {CHANGE_PERSONS,CHANGE_SHOW} from './types'

export const changeName = (e) => dispatch => {
	console.log("changeName" + e.target.value);
	dispatch({
		type: CHANGE_PERSONS,
		payload: e.target.value
	})
}

export const showContent = (e) => dispatch => {
	console.log(showContent);
	dispatch({
		type: CHANGE_SHOW,
		payload: e.target.value
	})
}
